CREATE OR REPLACE TABLE aircraft (
"index" INTEGER,
  "Aircraft_Id" TEXT,
  "Aircraft_Type" TEXT,
  "Mass" INTEGER,
  "Length" INTEGER,
  "Cost" INTEGER,
  "Capacity" INTEGER
);
CREATE OR REPLACE TABLE airlines (
"index" INTEGER,
  "Airline_Code" TEXT,
  "Airline_Name" TEXT,
  "Description" TEXT,
  "Market_Cap" INTEGER,
  "Employees" INTEGER,
  "Age" INTEGER
);
CREATE OR REPLACE TABLE airports (
"index" INTEGER,
  "Airport_Code" TEXT,
  "Airport_Name" TEXT,
  "Airport_Employees" INTEGER,
  "Airport_Size" INTEGER
);
CREATE OR REPLACE TABLE flight_summary_data (
"index" INTEGER,
  "Date" TEXT,
  "ASM_Domestic" INTEGER,
  "ASM_International" REAL,
  "Flights_Domestic" INTEGER,
  "Flights_International" REAL,
  "Passengers_Domestic" INTEGER,
  "Passengers_International" REAL,
  "RPM_Domestic" INTEGER,
  "RPM_International" REAL,
  "Airline_Code" TEXT,
  "Airport_Code" TEXT
);

CREATE OR REPLACE TABLE individual_flights (
"index" INTEGER,
  "Flight_Id" INTEGER,
  "Airline_Code" TEXT,
  "Departure_Airport_Code" TEXT,
  "Destination_Airport_Code" TEXT,
  "Aircraft_Id" TEXT
);

